import React from 'react';
import CopyrightIcon from '@material-ui/icons/Copyright';

const Footer=()=>{
    return(
        <>
        <footer className="text-center w-100 bg-light mt-5">
            <p><CopyrightIcon /> 2020 Jay. All Rights Reserved | Terms and Conditions</p>
        </footer> 


        </>

    )
 
}
export default Footer;
